const Button = ({text, color}) => {
    return (
        <button type="submit" className="btn btn-primary" style={{background: color}}
                onClick={e => {
                    onClick(e)
                }
                }>{text}
        </button>
    );
};

Button.defaultProps = {
    color: 'green',
}

export default Button;
